    data: |
      SELECT ALL col0 AS col2 FROM tab0 WHERE NOT ( col1 * - - col2 / col0 + - col0 ) BETWEEN ( NULL ) AND - 88 * + col2;
  - name: tab0

outputs:
  - name: q9670.out
    data: |
      15
      87
      97
